INSERT INTO `v1_61e58b7ef824940fee0d4d022ad6350365d080c0ef50600bbac2c78301a84f01` VALUES ("", 1110501, 4, 11, 1, 1, 1110501043, "この蝋燭は、もしや君が作ったのか？\nなに、精油にそんな希少な成分を？\nわざわざぼくの誕生日を祝うために？\n後輩……君という子は……！", 0, 111011, 0);
INSERT INTO `v1_61e58b7ef824940fee0d4d022ad6350365d080c0ef50600bbac2c78301a84f01` VALUES ("", 1110501, "", 91, "", "", 1110501044, "", "", 0, "");
