INSERT INTO `v1_61e58b7ef824940fee0d4d022ad6350365d080c0ef50600bbac2c78301a84f01` VALUES ("", 1110501, 4, 11, 1, 1, 1110501046, "しかし蝋燭はいいが、この土台部分──\nいや、バースデーケーキとかいう祝祭の\n文化か。ううむ気持ちは有難いが、\n食の細いぼくには若干拷問サイズだ……", 0, 111011, 0);
INSERT INTO `v1_61e58b7ef824940fee0d4d022ad6350365d080c0ef50600bbac2c78301a84f01` VALUES ("", 1110501, "", 91, "", "", 1110501047, "", "", 0, "");
